import React from "react";
import "App.scss";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { Home } from "components/Home";
import { Login } from "components/Login";
import Saved from "components/container/WithSaved";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/confirmation">
            <Confirmation />
          </Route>
          <Route path="/login">
            <Login />
          </Route>
          <Route path="/test-user">
            <Saved env="test" />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
